import cities from './cities.json';

function table() {

    return(
        <div>
        <div>
        {cities.map(function data() {
         return(
             <div>
                 <h1>data.citie</h1>
                 <h2>data.peples</h2>
             </div>
         )   
        })}
        </div>
        </div>
    )
    
}
export default table;
